}

export async function getStaticProps() {
    const router = useRouter();
    const query = router.query;
    const hotel = await apiService.getAll(API.HOTELS.getAll + `/${query}`);
    const comments = await apiService.getAll(API.HOTELS.getAll + `/${query}/` + API.COMMENTS.get);
    return {
        props: {
            hotel: hotel,
            comments: comments
        }
    }
}
